                if(!fired[i+1][j]){
                fired[i+1][j]=true;
                q.add(new Pair(i+1,j));
                }
            } if(j+1<ymax){
                if(!fired[i][j+1]){
                fired[i][j+1]=true;
                q.add(new Pair(i,j+1));
                }
            }
        }    
         return index;   


    }


