    private static class TaskB {



        static final long max = 1000000000000000000L;

        static final double eps = 0.0000001;

        static final long mod = 1000000007;

        static int N, M, K;

        static long X, Y;

        static boolean F[][][];

        static int D[][];



        void solve(InputReader in, PrintWriter out) throws IOException {



            N = in.nextInt();

            M = in.nextInt();

            K = in.nextInt();



            F = new boolean[K][N][M];

            D = new int[N][M];



            for (int i = 0; i < N; i++)

                for (int j = 0; j < M; j++)

                    D[i][j] = Integer.MAX_VALUE;



            List<Pair> list = new ArrayList<>();



            for (int i = 0; i < K; i++) {

                list.add(new Pair(in.nextInt() - 1, in.nextInt() - 1));

            }





            for (int i = 0; i < N; i++)

                for (int j = 0; j < M; j++)

                    for (int k = 0; k < K; k++)

                        D[i][j] = Math.min(D[i][j], Math.abs(list.get(k).X - i) + Math.abs(list.get(k).Y - j));





            int res = Integer.MIN_VALUE;

            for (int j = 0; j < N; j++)

                for (int k = 0; k < M; k++)

                    if (D[j][k] > res) {

                        X = j + 1;

                        Y = k + 1;

                        res = D[j][k];

                    }



            out.println(X + " " + Y);



        }



        void bfs(int K, Pair P) {



            Queue<Pair> Q = new LinkedList<>();

            F[K][P.X][P.Y] = true;

            D[P.X][P.Y] = 0;

            Q.add(P);





            while (!Q.isEmpty()) {



                P = Q.poll();

                int X = P.X;

                int Y = P.Y;



                if (check(X - 1, Y) && !F[K][X - 1][Y]) {

                    F[K][X - 1][Y] = true;

                    if (D[X - 1][Y] > D[X][Y] + 1) {

                        D[X - 1][Y] = D[X][Y] + 1;

                        Q.add(new Pair(X - 1, Y));

                    }

                }



                if (check(X + 1, Y) && !F[K][X + 1][Y]) {

                    F[K][X + 1][Y] = true;

                    if (D[X + 1][Y] > D[X][Y] + 1) {

                        D[X + 1][Y] = D[X][Y] + 1;

                        Q.add(new Pair(X + 1, Y));

                    }

                }



                if (check(X, Y - 1) && !F[K][X][Y - 1]) {

                    F[K][X][Y - 1] = true;

                    if (D[X][Y - 1] > D[X][Y] + 1) {

                        D[X][Y - 1] = D[X][Y] + 1;

                        Q.add(new Pair(X, Y - 1));

                    }

                }



                if (check(X, Y + 1) && !F[K][X][Y + 1]) {

                    F[K][X][Y + 1] = true;

                    if (D[X][Y + 1] > D[X][Y] + 1) {

                        D[X][Y + 1] = D[X][Y] + 1;

                        Q.add(new Pair(X, Y + 1));

                    }

                }



            }



        }



        boolean check(int X, int Y) {

            return !(X < 0 || X >= N || Y < 0 || Y >= M);

        }



        class Pair {

            int X, Y;



            Pair(int X, int Y) {

                this.X = X;

                this.Y = Y;

            }

        }



        long gcd(long A, long B) {

            if (B == 0) return A;

            return gcd(B, A % B);

        }



        boolean isPrime(long n) {

            if (n <= 1 || n > 3 && (n % 2 == 0 || n % 3 == 0))

                return false;

            for (long i = 5, j = 2; i * i <= n; i += j, j = 6 - j)

                if (n % i == 0)

                    return false;

            return true;

        }



        boolean isEqual(double A, double B) {

            return Math.abs(A - B) < eps;

        }



        double dist(double X1, double Y1, double X2, double Y2) {

            return Math.sqrt((X1 - X2) * (X1 - X2) + (Y1 - Y2) * (Y1 - Y2));

        }



        boolean nextPer(int[] data) {

            int i = data.length - 1;

            while (i > 0 && data[i] < data[i - 1]) {

                i--;

            }

            if (i == 0) {

                return false;

            }

            int j = data.length - 1;

            while (data[j] < data[i - 1]) {

                j--;

            }

            int temp = data[i - 1];

            data[i - 1] = data[j];

            data[j] = temp;

            Arrays.sort(data, i, data.length);

            return true;

        }



        long pow(long A, long B, long MOD) {

            if (B == 0) {

                return 1;

            }

            if (B == 1) {

                return A;

            }

            long val = pow(A, B / 2, MOD);

            if (B % 2 == 0) {

                return val * val % MOD;

            } else {

                return val * (val * A % MOD) % MOD;

            }

        }

    }



    private static class InputReader {

        StringTokenizer st;

        BufferedReader br;



        public InputReader(InputStream s) {

            br = new BufferedReader(new InputStreamReader(s));

        }



        public InputReader(FileReader s) throws FileNotFoundException {

            br = new BufferedReader(s);

        }



        public String next() {

            while (st == null || !st.hasMoreTokens())

                try {

                    st = new StringTokenizer(br.readLine());

                } catch (IOException e) {

                    throw new RuntimeException(e);

                }

            return st.nextToken();

        }



        public int nextInt() {

            return Integer.parseInt(next());

        }



        public long nextLong() {

            return Long.parseLong(next());

        }



        public String nextLine() {

            try {

                return br.readLine();

            } catch (IOException e) {

                throw new RuntimeException(e);

            }

        }



        public double nextDouble() {

            return Double.parseDouble(next());

        }



        public boolean ready() {

            try {

                return br.ready();

            } catch (IOException e) {

