		for(int i=0;i<n;i++)
			Arrays.fill(dist[i], -1);
		ArrayDeque<Integer> x=new ArrayDeque<>(),y=new ArrayDeque<>();
		for(int i=0;i<k;i++) {
			int xi=sc.nextInt()-1,yi=sc.nextInt()-1;
			dist[xi][yi]=0;
			x.add(xi);
