	    pw = null;

	}



	int max_x = sc.nextInt();

	int max_y = sc.nextInt();

	int start_num = sc.nextInt();

	HashSet<int[]> start = new HashSet<int[]>();

	for(int i=0; i<start_num; i++){

	    int[] cell = new int[2];

	    cell[0] = sc.nextInt();

	    cell[1] = sc.nextInt();

	    start.add(cell);

	}



	int[] result = new int[]{1,1};

	int resultLen = 0;

	for(int i=1; i<=max_x; i++){

	    for(int j=1; j<=max_y; j++){

