                    Pair p = new Pair(X, Y);

                    q.add(p);

                }

            }



            //System.out.println(cur);

        }



        // 5. find max pair by dist array

        Pair res = null;

        int maxx = -1;

        for (int i=0; i<n; i++) {

            for (int j=0; j<m; j++) {

                if (dist[i][j] > maxx) {

                    maxx = dist[i][j];

                    res = new Pair(i+1, j+1);

                }

            }

        }



        return res;

    }





