		public Rectangle find(InputReader in, PrintWriter out,int x1, int y1, int x2, int y2, int n) {
			Rectangle rec = new Rectangle();

			int ansx1 = x1;
			int ansx2 = x2;
			int ansy1 = y1;
			int ansy2 = y2;

			int l = x1;
			int r = x2;


			// quero o minimo v >= x2 
			while(r >= l) {
				int mid = (r + l) / 2;

				if(ask(in,out,x1,y1,mid,y2) == 1) {
					ansx2 = mid;
					r = mid - 1;
				} else {
					l = mid + 1;
				}

			}

			//out.printf("x2 = %d", ansx2);



			r = x2;
			l = x1;

			// quero o maximo v <= x1

			while(r >= l) {
				int mid = (r + l) / 2;

				if(ask(in,out,mid,y1,x2,y2) == 1) {
					ansx1 = mid;
					l = mid + 1;
				} else {
					r = mid - 1;
				}

			}

			//out.printf("x1 = %d", ansx1);


			l = y1;
			r = y2;

			// quero o minimo v >= y2 
			while(r >= l) {
				int mid = (r + l) / 2;

				if(ask(in,out,x1,y1,x2,mid) == 1) {
					ansy2 = mid;
					r = mid - 1;
				} else {
					l = mid + 1;
				}

			}

			//out.printf("y2 = %d", ansy2);





			r = y2;
			l = y1;


			// quero o maximo v <= y1

			while(r >= l) {
				int mid = (r + l) / 2;

				if(ask(in,out,x1,mid,x2,y2) == 1) {
					ansy1 = mid;
					l = mid + 1;
				} else {
					r = mid - 1;
				}

			}

			//out.printf("y1 = %d", ansy1);




			rec.x1 = ansx1;
			rec.x2 = ansx2;
			rec.y1 = ansy1;
			rec.y2 = ansy2;



			return rec;
		}

		public int ask(InputReader in, PrintWriter out, int x1, int y1, int x2, int y2) {
			System.out.printf("? %d %d %d %d\n",x1,y1,x2,y2);
			System.out.flush();
			return in.nextInt();
		}
