        int n = sc.nextInt();
        int q = sc.nextInt();
        int[] vv = sc.na(n);

        double[] ans = new double[n];

        for (int i = 0; i < n; i++) {
            ans[i] = q;
            for (int s = 0; s < i; s++) {
                if (Math.abs(vv[i] - vv[s]) > q * 2) continue;
                double diff = 4 * q * q - Math.abs(vv[i] - vv[s]) * Math.abs(vv[i] - vv[s]);
                diff = Math.sqrt(diff);
                ans[i] = Math.max(ans[i], diff + ans[s]);
            }
            out.print(ans[i] + " ");
        }
    }


