				if (dx <= r * 2 + EPS) {
					double dy = Math.sqrt(4.0 * r * r - dx * dx);
					y = Math.max(y, p[j][1] + dy);
				}
			}
			out.printf("%.12f ", y);
			p[i][0] = x;
			p[i][1] = y;
		}
		out.println();
