    static class Node implements Comparable<Node>{
        int dist,idx;

        Node(int idx,int dist){
            this.idx = idx;
            this.dist = dist;
        }

        public int compareTo(Node o) {
            return o.dist-this.dist;
        }
    }

    static void removeNodes(int s,int e){
        vis[s]=true;
        while(s!=e){
            vis[s] = true;
            s = parent[s];
        }
        vis[s]=true;
        return;
    }

    static int calcdist(int s){
        int res=0;
        int tmp=0;
        for(int e:adj[s]){
            if(e!=parent[s]){
                tmp= calcdist(e);
                if(1+tmp>res){
                    res = 1+tmp;
                    back[s] = back[e];
                }
            }
        }

        if(res==0) back[s]=s;
        return dist[s] = res;
    }

    static void dfs(int s,int p){
        for(int e:adj[s]){
            if(e!=p){
                parent[e]=s;
                dfs(e,s);
            }
        }
        return;
    }

    static void makeroot(int s){
        Queue<Integer> q = new LinkedList<>();
        q.add(s);

        int elm=0;
        while(q.size()!=0){
            elm = q.remove();
            for(int e:adj[elm]){
                if(!vist[e]){
                    vist[e]=true;
                    q.add(e);
                    root = e;
                }
            }
        }
        return;
    }


