	public static void prime(int n){
		int[] isPrime = new int[n+1];
		Arrays.fill(isPrime, 1);
		for(long i = 2;i<=n;i++){
			if (isPrime[(int)i] == 1){
				for(long j = i*i;j<=n;j+=i){
					isPrime[(int)j] = 0;
				}
			}
		}
		for(int j = 3;j<=n;j++){
			if (isPrime[j] == 1){
				primes.add(j);
			}
		}
	}
	public static int factorize(long n) { 

	 	long prod = 1;
        int count = 0; 
        while (n%2 == 0){
            n >>= 1; 
            count++; 
        } 
        if (count > 0 && count%2 == 1)
            prod *= 2L;
        for (long i : primes) { 
        	if (i*i > n)
        		break;
            count = 0; 
            while (n % i == 0) { 
                count++; 
                n = n / i; 
            } 
            if (count > 0 && count%2 == 1)
                prod *= i;
        }  
        if (n > 2)
        	prod *= n;
        return (int)prod;
    }
